import React from "react";
import "./Navbar.css";
function Navbar() {
  return (
    <>
      <nav className="nav-wrapper">
        <div className="nav-content">
          <img className="logo" />
          <ul>
            <li>
              <a className="menu-item">Home</a>
            </li>
          </ul>
        </div>
      </nav>
    </>
  );
}

export default Navbar;
